import Layout from "../../components/layout";
import React, { Component } from "react";
import fetch from "isomorphic-unfetch";

class UserProfile extends Component {
  constructor(props) {
    super(props);

    this.state = {
      nombre: "",
      apellido: "",
      correo: "",
      clave: "",
    };
  }

  render() {
    console.log(this.props + "hola amigos");
    return (
      <Layout>
        <h1>hola soy el usuario: </h1>
      </Layout>
    );
  }
}

UserProfile.getInitialProps = async ({ query }) => {
  var usuario = query.id_user.split("_")[1];
  const res = await fetch("http://localhost:8080/usuarios/" + usuario);
  const resJSON = await res.json();
  console.log(resJSON);
  return { dataUsuario: resJSON };
};

export default UserProfile;
